import ControlInfoItem from "./ControlInfoItem";

function MenuDiv(props) {
    return (
        <div style={{position: "relative", backgroundColor: "rgba(0,0,0,0.5)", width: "26vw", height: "30vw", margin: "2vw", border: "0.4vw solid black"}}>
            <h1 className={"strokedText3 textColor pixelFont"} style={{fontSize: "3.9vw", marginTop: "1vw", marginBottom: "1vw"}}>{props.title}</h1>
            {!props.globalLeaderboard && 
            <>
                <ControlInfoItem action="Move" control="WASD"></ControlInfoItem>
                <ControlInfoItem action="Aim/Fire" control="WASD"></ControlInfoItem>
            </>}
        </div>
    )
}

export default MenuDiv;
